import Body from './layouts/body/Body'
import Header from './layouts/header/Header';


console.warn = () => {};
console.log(this.props);
export default class App extends Component{
  render(){
    return(
      <div className='App'>
          <Router>
            <Header/>
            <Body/>
          </Router>
      </div>
    )
  }
}
